import React from "react";
import { getCurrentUser, logout } from "../services/authService";

function Home() {
  const user = getCurrentUser();

  return (
    <div>
      <h1>Bienvenido a la App</h1>
      {user ? (
        <div>
          <p>Estás logueado</p>
          <button onClick={logout}>Cerrar Sesión</button>
        </div>
      ) : (
        <p>No has iniciado sesión</p>
      )}
    </div>
  );
}

export default Home;
